    render() {
        const { item } = this.props;

        return (
            <div class='card z-depth-0 row s grey'>
                <div class='card-content col s3'>
                    <span class='card-title'>{item.song_title}</span>
                </div>
                <div class='card-content col s3'>
                    <span class='card-title'>{item.artist}</span>
                </div>
                <div class='card-content col s3'>
                    <span class='card-title'>{item.song_length}</span>
                </div>
                <div class='card-content col s3'>
                    <a class="btn-floating red" onClick={this.handleFavorite}><i class='material-icons'>favorite</i></a>
                    <a class="btn-floating black" onClick={this.handleAddToPlaylist}><i class='material-icons'>add_circle</i></a>
                </div>
            </div>
        );
    }
}
export default SearchListCard;
